import React from "react";
import { TextField } from "@mui/material";

const SearchBar = ({ query, setQuery }) => {
  return (
    <TextField
      label="Search for Movies"
      variant="outlined"
      fullWidth
      value={query}
      onChange={(e) => setQuery(e.target.value)}
      sx={{ marginBottom: 3 }}
    />
  );
};

export default SearchBar;
